import React from 'react';
import { useHistory } from 'react-router-dom';
import './Logout.css';

const Logout = ({ handleLogout }) => {
  const history = useHistory();

  const handleLogoutClick = () => {
    // Call the handleLogout function passed from the parent component
    handleLogout();
    // Redirect to the desired page after successful logout
    history.push('/');
  };

  return (
    <div className="logoutContainer">
      <h2 className="logoutTitle">Logout</h2>
      <button onClick={handleLogoutClick} className="logoutButton">Logout</button>
    </div>
  );
};

export default Logout;
